import React, { Component } from 'react';
import Base from './base';

class Calculator extends Component {
    state = {

    };
    render() { 
        return (
            <React.Fragment>
                <Base>
                    <div className='calculator'>
                        <div className="output">
                            <div className="last-output">96*</div>
                            <div className="current-output">147848946546846544646545423</div>
                        </div>
                        <div className="input">
                            <button>AC</button>
                            <button>x^2</button>
                            <button>/</button>
                            <button>Del</button>
                            <button>7</button>
                            <button>8</button>
                            <button>9</button>
                            <button>*</button>
                            <button>4</button>
                            <button>5</button>
                            <button>6</button>
                            <button>-</button>
                            <button>1</button>
                            <button>2</button>
                            <button>3</button>
                            <button>+</button>
                            <button>+/-</button>
                            <button>0</button>
                            <button>.</button>
                            <button>=</button>
                        </div>
                    </div>
                </Base>
            </React.Fragment>
        );
    }
}
 
export default Calculator;
